#include <stdio.h>
#include <stdlib.h>
#include <limits.h>
#include <stdbool.h>
#include <string.h>

#define V 144 // Number of vertices in the graph
#define MAX_CITY_NAME_LENGTH 100

// Structure to represent a city
struct City
{
    int number;
    char name[MAX_CITY_NAME_LENGTH];
};



// A utility function to find the vertex with minimum distance value
int minDistance(int dist[], bool sptSet[])
{
    int min = INT_MAX, min_index;

    for (int v = 0; v < V; v++)
        if (sptSet[v] == false && dist[v] <= min)
            min = dist[v], min_index = v;

    return min_index;
}

void appendToString(char *result, int value) {
    char buffer[12]; // Enough to hold int and comma
    sprintf(buffer, "%d,", value);
    strcat(result, buffer);
}

// Modified function to store the path in a string
void printPath(int parent[], int j, char *result)
{
    if (parent[j] == -1)
    {
        appendToString(result, j);
        return;
    }

    printPath(parent, parent[j], result);
    appendToString(result, j);
}

// Function to store the solution in a string and find the nodes traversed
void printSolution(int dist[], int parent[], int src, int target, char *result)
{
    printPath(parent, target, result);
    // Remove the trailing comma
    result[strlen(result) - 1] = '\0';
}

// Function that implements Dijkstra's algorithm for a graph represented using adjacency matrix representation
void dijkstra(int graph[V][V], int src, int target, char *result)
{
    int dist[V];    // The output array. dist[i] will hold the shortest distance from src to i
    bool sptSet[V]; // sptSet[i] will be true if vertex i is included in the shortest path tree or shortest distance from src to i is finalized
    int parent[V];  // Parent array to store shortest path tree

    // Initialize all distances as INFINITE and sptSet[] as false
    for (int i = 0; i < V; i++)
    {
        dist[i] = INT_MAX;
        sptSet[i] = false;
        parent[i] = -1;
    }

    // Distance of source vertex from itself is always 0
    dist[src] = 0;

    // Find shortest path for all vertices
    for (int count = 0; count < V - 1; count++)
    {
        // Pick the minimum distance vertex from the set of vertices not yet processed
        int u = minDistance(dist, sptSet);

        // Mark the picked vertex as processed
        sptSet[u] = true;

        // Update dist value of the adjacent vertices of the picked vertex
        for (int v = 0; v < V; v++)
        {
            if (!sptSet[v] && graph[u][v] && dist[u] != INT_MAX && dist[u] + graph[u][v] < dist[v])
            {
                dist[v] = dist[u] + graph[u][v];
                parent[v] = u;
            }
        }
    }

    // Clear the result string
    result[0] = '\0';

    // Store the solution in the result string
    printSolution(dist, parent, src, target, result);
}


